var Table={create:function(a,f,c){f=f||2;c=c||0;var b=[];for(var e=0;e<f;e++){b.push([]);for(var d=0;d<a;d++){b[e].push(c)}}return b},show:function(a){for(var b=0;b<a.length;b++){console.log(a[b])}},h:function(a,b){b=b||0;return a[b]},v:function(a,d){d=d||0;var b=[];for(var c=0;c<a.length;c++){b.push(a[c][d])}return b},d1:function(a,d){d=d||0;var b=[];if(d>=0){for(var c=0;c<a.length-d;c++){b.push(a[c][c+d])}}else{d=Math.abs(d);for(var c=0;c<a.length-d;c++){b.push(a[c+d][c])}}return b},d2:function(a,d){d=d||0;var b=[];if(d>=0){for(var c=0;c<a.length-d;c++){b.push(a[c][2-c-d])}}else{d=Math.abs(d);for(var c=0;c<a.length-d;c++){b.push(a[c+d][2-c])}}return b},pattern:function(b,f){var a=[];var e=b.length;for(var d=0;d<e;d++){var c=Table.h(b,d).join("").indexOf(f);if(c!==-1){a.push(["h",d,c])}var c=Table.v(b,d).join("").indexOf(f);if(c!==-1){a.push(["v",d,c])}}for(var d=-e+1;d<e;d++){var c=Table.d1(b,d).join("").indexOf(f);if(c!==-1){a.push(["d1",d,c])}var c=Table.d2(b,d).join("").indexOf(f);if(c!==-1){a.push(["d2",d,c])}}if(a[0]===undefined){return false}else{return a}}};